import ActionButton from "./ActionButton";
import styled from "styled-components";

const Input = styled.input`
  background: white;
  border: none;
  padding: 8px 4px;
  min-width: 300px;
  text-align: left;
  line-height: 24px;
  font-size: 13px;
  transition: all 0.2s ease;
  outline: none;
`

const Container = styled.div`
  margin: 0 auto;
  text-align: left;
  line-height: 24px;
  font-size: 13px;
  transition: all 0.2s ease;
  outline: none;
`


export function AddTodo() {
    return (
        <Container>
            <Input type='text'/>
            <ActionButton action='add'>
                Add
            </ActionButton>
        </Container>
    )
}
